import { useState, useContext } from 'react';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';
import axios from 'axios';
import { BASEURL } from './baseURL';
import { AppContext } from './App';


function LoginForm(){

  const [username, setUsername] = useState("")
  const [password, setPassword] = useState("")


  function LoginUser(){
    axios.post(BASEURL + "/auth/jwt/create/",{
      username: username,
      password: password
    }).then(function (response) {
      console.log(JSON.stringify(response.data));
      document.cookie = JSON.stringify(response.data) +";expires=Fri, 31 Dec 9999 23:59:59 GMT;";
      const { loggedIn, setLoggedIn } =useContext(AppContext);
    })
    .catch(function (error) {
      console.log(error);
    });
  }

  return(
    <Form style={
      {margin: 10}
    }>

    <Form.Group className="mb-3" controlId="LoginForm.username">
      <Form.Label>Username</Form.Label>
      <Form.Control
          type= "text"
          placeholder="Username"
          required
          onChange={(e) => setUsername(e.target.value)}
        />
    </Form.Group>

    <Form.Group className="mb-3" controlId="LoginForm.password">
      <Form.Label>Password</Form.Label>
      <Form.Control
          type= "password"
          placeholder="Password"
          required
          onChange={(e) => setPassword(e.target.value)}
      />
    </Form.Group>

    <Button 
      variant="primary" 
      className="mb-3" 
      type="submit"
      onClick={(e) => {e.preventDefault(); LoginUser()}}>
        Register
    </Button>

    </Form>
  );
}

export default LoginForm;
